"use strict";
module.exports = JSON.parse('[{"slug":"computer-vision-for-aras","id":1,"title":{"small":"Computer vision Â· ARAS","big":"Computer vision for advanced rider assistance"},"clientURLLink":"https://yellow.systems/works/computer-vision-for-aras","projectHeaderImage":"/img/portfolio/project2/bg1.jpg","videoLink":"https://vimeo.com/127203262","clientURLName":"ARAS startup (case-study inspired by Yellow Systems)","date":"2024","categories":[{"id":1,"name":"Business","link":"#"}],"tags":[{"id":1,"name":"Python","link":"#"},{"id":2,"name":"C++","link":"#"},{"id":3,"name":"XGBoost","link":"#"},{"id":4,"name":"ONNX","link":"#"}],"intro":{"content":"An AI-powered Advanced Rider Assistance System (ARAS) that uses computer vision to detect road threats in real time and warn motorcycle riders before a collision happens. I worked on improving model accuracy, optimizing resource usage, and helping migrate the solution to a new edge AI platform.","spmList":[{"id":1,"name":"Enhanced frontâ€‘collision and safety monitoring using optimized ML models."},{"id":2,"name":"Reduced inference resource usage on edge devices while preserving realâ€‘time performance."},{"id":3,"name":"Migrated the computerâ€‘vision pipeline from Jetson to a Hailoâ€‘based edge AI platform."},{"id":4,"name":"Shipped and validated the system with thousands of riders in realâ€‘world traffic conditions."}]},"previewImage":"/img/portfolio/portfolio/1/1.jpg","gallery":["/img/portfolio/project2/pro1.jpeg","/img/portfolio/project2/pro2.jpeg","/img/portfolio/project2/pro3.jpeg","/img/portfolio/project2/pro4.jpeg","/img/portfolio/project2/pro5.jpeg"],"description":{"content":"This project focuses on making motorcycle riding safer using computer vision and edge AI. The ARAS device is mounted on the bike with front and rear wideâ€‘angle cameras feeding an onâ€‘board edge module. I helped redesign the ML pipeline for frontâ€‘collision prevention, moving from the previous model to an XGBoostâ€‘based solution with a carefully selected feature set. This increased core safety metrics and made hazard detection more reliable without overwhelming riders with false alerts.\\n\\nOn the engineering side, I optimized the detection and classification models so they consume roughly half the compute resources on the edge hardware while keeping accuracy stable. That work included model pruning, better batching, and exporting the models to ONNX for efficient deployment. Finally, I participated in the migration from a Jetsonâ€‘based setup to a Hailo edge AI platform, validating performance and power consumption across many realâ€‘world rides.\\n\\nThe result is an ARAS that can analyze 360Â° surroundings in real time, raise nonâ€‘intrusive alerts to the rider, and continuously stream anonymized safety events to the cloud for fleet analytics. The improved accuracy and lower resource usage translate directly into safer rides, longer device battery life, and a smoother path to largeâ€‘scale deployment.","techStack":{"frontend":"Edge device interface and real-time visualization components for rider alerts and system status.","backend":"Python-based ML pipeline with XGBoost models, C++ for performance-critical components, ONNX runtime for optimized inference, and real-time data processing pipelines.","services":"Hailo edge AI platform, cloud analytics services for fleet data aggregation, and real-time streaming infrastructure for safety event processing.","other":"Computer vision algorithms, model optimization and pruning techniques, edge computing architecture, and IoT device integration."}},"liveDemo":{"label":"Live demo","url":"https://yellow.systems/works/computer-vision-for-aras"},"nextTitle":"Safer rides through edge AI and computer vision."},{"slug":"polymertorg","id":2,"title":{"small":"B2B Platform Â· Business Automation","big":"Polymertorg"},"clientURLLink":"https://dev.family/portfolio/polymertorg","projectHeaderImage":"/img/portfolio/project2/bg2.jpg","videoLink":"https://vimeo.com/127203262","clientURLName":"Polymertorg Company","date":"February 2021","categories":[{"id":1,"name":"Business","link":"#"}],"tags":[{"id":1,"name":"React","link":"#"},{"id":2,"name":"Next.js","link":"#"},{"id":3,"name":"Laravel","link":"#"},{"id":4,"name":"PostgreSQL","link":"#"}],"intro":{"content":"A comprehensive B2B personal account platform for Polymertorg, an official supplier of polymer raw materials in Belarus. The project involved digitizing sales processes, automating customer interactions, and integrating with existing 1C systems to reduce labor costs and improve service quality.","spmList":[{"id":1,"name":"Built personal accounts for B2B customers with order management and real-time inventory."},{"id":2,"name":"Integrated seamless 1C synchronization with reliable data exchange and error handling."},{"id":3,"name":"Automated 80% of small customer interactions, freeing managers for high-value clients."},{"id":4,"name":"Implemented ticket system, chat functionality, and personalized catalog features."}]},"previewImage":"/img/portfolio/portfolio/1/pro10.jpeg","gallery":["/img/portfolio/project2/pro6.jpeg","/img/portfolio/project2/pro7.jpeg","/img/portfolio/project2/pro8.jpeg","/img/portfolio/project2/pro10.jpeg","/img/portfolio/project2/pro9.jpeg"],"description":{"content":"Polymertorg came to us with a clear business challenge: small customers (20% of profit) were consuming 80% of managers\' time, while large customers (80% of profit) only needed 20% of attention. The solution was to automate sales for small customers through a personal account system.\\n\\nThis wasn\'t just linking a typical personal account to an existing website. We reexamined most company processes together with the client and built a unique tool customized to their specific B2B needs. The work involved business analysis, prototyping, design, development, and 1C integration over approximately 6 months.\\n\\nKey technical achievements include robust 1C integration with autonomous operation (the personal account functions even if 1C is unavailable), real-time price and inventory updates, secure VPN connection for data exchange, and a comprehensive ticket system for requests like reconciliation acts and detail changes.\\n\\nThe platform features personalized catalogs (only relevant product groups visible per customer), shopping cart with real-time price updates and stock status, order history, payment calendar, built-in analytics, and chat functionality with managers. All notifications are configurable (email, instant messengers, in-app).\\n\\nThe result: reduced labor costs, improved service quality, structured workflows, and a modern digital experience that differentiates Polymertorg from competitors. The platform successfully automates interactions with small customers while maintaining the high-touch service model for large accounts.","techStack":{"frontend":"React.js for dynamic user interfaces, Next.js for server-side rendering and SEO optimization, responsive design for mobile and desktop access, and real-time UI updates for inventory and pricing.","backend":"Laravel PHP framework for robust API development, PostgreSQL database for reliable data storage, RESTful API architecture, and secure authentication and authorization systems.","services":"1C ERP system integration via VPN, real-time data synchronization services, email and instant messaging notification services, and secure payment processing integration.","other":"Business process automation, custom analytics and reporting tools, chat system implementation, and comprehensive ticket management system."}},"liveDemo":{"label":"Live demo","url":"https://dev.family/portfolio/polymertorg"},"nextTitle":"Digitizing B2B sales through automation and seamless system integration."},{"slug":"generative-ai-process-optimization","id":3,"title":{"small":"Generative AI Â· Fintech","big":"Generative AI for Process Optimization"},"clientURLLink":"https://yellow.systems/works/ai-documentation-processing","projectHeaderImage":"/img/portfolio/project2/bg3.jpg","videoLink":"https://vimeo.com/127203262","clientURLName":"US Insurance Company (case-study inspired by Yellow Systems)","date":"2024","categories":[{"id":1,"name":"Finance","link":"#"}],"tags":[{"id":1,"name":"Generative AI","link":"#"},{"id":2,"name":"NLP","link":"#"},{"id":3,"name":"Python","link":"#"},{"id":4,"name":"Machine Learning","link":"#"}],"intro":{"content":"A generative AI platform for optimizing internal insurance processes, including automated underwriting, claims processing, predictive analytics, and customer interaction chatbots. Built for a US-based insurance company to enhance operational efficiency and customer satisfaction through AI-driven automation.","spmList":[{"id":1,"name":"Automated underwriting using generative AI to analyze historical data and assess risk factors."},{"id":2,"name":"Claims processing automation with NLP algorithms for document analysis and validation."},{"id":3,"name":"Predictive analytics models for fraud detection, claim estimation, and pricing optimization."},{"id":4,"name":"AI-driven chatbots for handling routine customer queries and policy inquiries."}]},"previewImage":"/img/portfolio/portfolio/1/pro12.jpg","gallery":["/img/portfolio/project2/pro11.jpeg","/img/portfolio/project2/pro12.jpeg","/img/portfolio/project2/pro13.jpeg","/img/portfolio/project2/pro15.jpeg","/img/portfolio/project2/pro14.jpeg"],"description":{"content":"A US-based insurance company approached us with a need to enhance operational efficiency and customer satisfaction. They wanted to use generative AI to optimize various internal processes, focusing on automating routine tasks, improving underwriting processes, and streamlining claims management.\\n\\nThe solution involved building a comprehensive platform for internal usage that would facilitate process optimization across multiple departments. Key features include automated underwriting that uses generative AI to analyze historical underwriting data, assess risk factors, and generate optimized underwriting models, resulting in quicker and more accurate policy decisions.\\n\\nFor claims processing, we implemented natural language processing (NLP) algorithms to analyze and extract relevant information from claims documents, automating claims validation and processing workflows. The platform also includes predictive analytics capabilities where generative models predict potential fraud cases, estimate claim amounts, and optimize pricing models for insurance policies.\\n\\nCustomer interaction was enhanced through AI-driven chatbots that handle routine customer queries, policy inquiries, and basic claims status updates, significantly reducing the workload on customer support teams.\\n\\nTechnical challenges included ensuring data quality and availability for training AI models, which we addressed through robust data cleaning processes and generative data augmentation techniques. We also integrated the new solution seamlessly with legacy systems using various APIs to enable smooth communication between new AI components and existing infrastructure.\\n\\nThe result: a fully operational solution that made the underwriting process more efficient, reduced claims processing time, and improved overall operational efficiency while maintaining high accuracy standards.","techStack":{"frontend":"Modern web dashboard for internal users, interactive data visualization components, and responsive UI for policy and claims management interfaces.","backend":"Python-based AI/ML services with generative models, NLP processing pipelines, machine learning frameworks for predictive analytics, and RESTful API services for system integration.","services":"AI model training and deployment infrastructure, document processing and OCR services, chatbot services with natural language understanding, and legacy system integration APIs.","other":"Generative AI models for underwriting optimization, fraud detection algorithms, data cleaning and augmentation pipelines, and comprehensive analytics and reporting systems."}},"liveDemo":{"label":"Live demo","url":"https://yellow.systems/works/ai-documentation-processing"},"nextTitle":"Optimizing business processes through generative AI and intelligent automation."},{"slug":"ai-platform-healthcare","id":4,"title":{"small":"Healthcare AI Â· API Platform","big":"AI Platform for Healthcare Developers"},"clientURLLink":"https://www.corti.ai/","projectHeaderImage":"/img/portfolio/project2/bg4.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"Corti (case-study inspired)","date":"2024","categories":[{"id":1,"name":"SaaS","link":"#"}],"tags":[{"id":1,"name":"Python","link":"#"},{"id":2,"name":"Node.js","link":"#"},{"id":3,"name":"Machine Learning","link":"#"},{"id":4,"name":"NLP","link":"#"}],"intro":{"content":"An AI platform for healthcare developers that enables building production-grade AI applications without infrastructure burden. Provides APIs designed for accuracy, speed, and scale, handling over 1 million healthcare interactions weekly.","spmList":[{"id":1,"name":"Speech Recognition API for real-time clinical conversation capture and transcription."},{"id":2,"name":"Text Generation API for radiology reports, clinical summaries, and documentation."},{"id":3,"name":"Ambient clinical documentation that automatically generates structured notes from conversations."},{"id":4,"name":"Clinical decision support with guidelines, risk scores, and next-step recommendations."}]},"previewImage":"/img/portfolio/portfolio/1/4.jpg","gallery":["/img/portfolio/project2/pro16.jpeg","/img/portfolio/project2/pro17.jpeg","/img/portfolio/project2/pro18.jpeg","/img/portfolio/project2/pro19.jpeg","/img/portfolio/project2/pro20.jpeg"],"description":{"content":"Built an AI platform specifically designed for healthcare developers to build production-grade AI applications without the complexity of managing infrastructure. The platform provides healthcare-native APIs that power real clinical workflows, enabling developers to ship faster, safer, and smarter.\\n\\nThe core platform includes multiple API endpoints: Speech Recognition API for converting clinical conversations into text with high accuracy, Text Generation API for creating structured clinical documentation, and specialized models for radiology report generation, pre-charting summarization, and clinical decision support.\\n\\nKey features include ambient clinical documentation that captures conversations in real-time and automatically generates structured clinical notes, eliminating manual documentation burden. The platform also provides patient engagement tools for follow-ups and reminders, RCM optimization for coding and billing workflows, and clinical decision support that surfaces guidelines and risk scores at the point of care.\\n\\nTechnical implementation focused on building APIs that are accurate, fast, and scalable. The platform handles over 1 million healthcare interactions weekly, demonstrating its reliability and performance. The infrastructure is designed for compliance with healthcare regulations, including HIPAA considerations, and provides sovereign cloud options for markets with strict data residency requirements.\\n\\nDeveloper experience was a priority. The platform includes AI Studio for prototyping with free credits, comprehensive documentation with real examples, and SDKs in Python, Node.js, and other languages to get developers started quickly. The API management dashboard provides monitoring, usage tracking, and developer community support.\\n\\nThe result is a platform that enables healthcare developers to build AI-powered applications faster, with built-in safety and compliance features, and the ability to scale from prototyping to enterprise-level deployments. The platform successfully powers applications across EHR systems, virtual care platforms, practice management tools, and patient engagement solutions.","techStack":{"frontend":"Developer dashboard and API management interface, AI Studio for prototyping and testing, and comprehensive documentation portal with interactive examples.","backend":"Node.js and Python backend services, RESTful API architecture, machine learning model serving infrastructure, and real-time processing pipelines for speech and text generation.","services":"Speech recognition services, NLP and text generation APIs, HIPAA-compliant cloud infrastructure, sovereign cloud deployment options, and API monitoring and analytics services.","other":"Healthcare-specific AI models, SDK development for multiple languages (Python, Node.js), compliance and security frameworks, and developer community support tools."}},"liveDemo":{"label":"Live demo","url":"https://www.corti.ai/"},"nextTitle":"Enabling healthcare developers to build AI applications faster, safer, and smarter."},{"slug":"xircle-ai-pharmaceutical-knowledge","id":5,"title":{"small":"Pharmaceutical AI Â· Knowledge Platform","big":"Future of Pharmaceutical Knowledge"},"clientURLLink":"https://xircle-ai.webflow.io/","projectHeaderImage":"/img/portfolio/project2/bg5.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"Xircle AI (case-study inspired)","date":"2024","categories":[{"id":1,"name":"SaaS","link":"#"}],"tags":[{"id":1,"name":"AI","link":"#"},{"id":2,"name":"NLP","link":"#"},{"id":3,"name":"Python","link":"#"},{"id":4,"name":"Webflow","link":"#"}],"intro":{"content":"An AI-powered pharmaceutical knowledge platform designed by physicians to bring clarity and safety to pharmaceutical information. Provides universal access to pharmaceutical knowledge for healthcare practitioners and patients, enabling safer treatment applications through intelligent AI assistance.","spmList":[{"id":1,"name":"Xircle Assist: AI knowledge and service companion for streamlining medical information."},{"id":2,"name":"Xircle Engage: Multi-channel engagement platform for understanding customer needs and interests."},{"id":3,"name":"Xircle Reach: Knowledge platform for publishing dedicated content to HCPs and patients."},{"id":4,"name":"SmPC search functionality with indexed and annotated pharmaceutical documents."}]},"previewImage":"/img/portfolio/portfolio/1/5.jpg","gallery":["/img/portfolio/project2/pro21.jpeg","/img/portfolio/project2/pro25.jpeg","/img/portfolio/project2/pro23.jpeg","/img/portfolio/project2/pro24.jpeg","/img/portfolio/project2/pro22.jpeg"],"description":{"content":"Built a comprehensive pharmaceutical knowledge platform powered by AI, designed by physicians to prioritize safety and simplicity in bringing universal access to pharmaceutical knowledge. The platform serves healthcare practitioners and patients, enabling safer treatment applications through intelligent AI assistance.\\n\\nThe platform consists of three core products: Xircle Assist, an AI knowledge and service companion that creates seamless customer experiences by streamlining medical information and improving processes. Xircle Engage enables effective digital engagement with customers by understanding their critical needs and interests, optimizing multi-channel engagement across all stakeholders in the patient care pathway. Xircle Reach supports HCPs and patients instantly by improving medical safety and making content easily accessible through a dedicated knowledge platform.\\n\\nTechnical implementation focused on indexing and annotating pharmaceutical documents at scale. The platform indexes thousands of product information documents, package leaflets, and compounds, making them searchable and accessible through an intelligent search interface. The SmPC (Summary of Product Characteristics) search functionality allows healthcare professionals to quickly find relevant pharmaceutical information.\\n\\nKey features include AI-powered document processing that extracts and structures pharmaceutical knowledge, natural language understanding for query processing, and a knowledge graph that connects related pharmaceutical information. The platform continuously grows and improves, with over 8,000 documents indexed and annotated, serving thousands of users across the healthcare industry.\\n\\nThe platform prioritizes safety in pharmaceutical knowledge delivery, ensuring that healthcare practitioners can apply treatments more safely with AI assistance. The system is designed to handle complex pharmaceutical queries, provide accurate information retrieval, and support decision-making processes in clinical settings.\\n\\nThe result is a platform that empowers healthcare businesses with smart pharmaceutical AI, enabling them to offer smart services to customers safely, engage effectively with customers digitally, and support HCPs and patients instantly. The platform has proven valuable for support teams, handling most queries automatically and providing specific, accurate help that improves medical safety and accessibility.","techStack":{"frontend":"Webflow-based responsive web platform, interactive search interfaces, and user-friendly knowledge access portals for HCPs and patients.","backend":"Python-based AI and NLP processing engines, document indexing and annotation systems, knowledge graph construction and query processing, and intelligent search algorithms.","services":"AI-powered document processing services, natural language understanding APIs, pharmaceutical knowledge base services, and multi-channel engagement platform infrastructure.","other":"Pharmaceutical document processing and annotation, knowledge graph technology, SmPC search functionality, and AI-powered content recommendation systems."}},"liveDemo":{"label":"Live demo","url":"https://xircle-ai.webflow.io/"},"nextTitle":"Bringing clarity and safety to pharmaceutical knowledge through intelligent AI."},{"slug":"drpawluk-ecommerce-redesign","id":6,"title":{"small":"Healthtech Â· E-commerce","big":"Modernizing Evidence-Based E-commerce for PEMF Therapy"},"clientURLLink":"https://www.halo-lab.com/project/drpawluk","projectHeaderImage":"/img/portfolio/project2/bg6.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"DrPawluk.com (case-study inspired by Halo Lab)","date":"2024","categories":[{"id":1,"name":"Business","link":"#"}],"tags":[{"id":1,"name":"Web Design","link":"#"},{"id":2,"name":"Frontend Development","link":"#"},{"id":3,"name":"Branding","link":"#"},{"id":4,"name":"JavaScript","link":"#"}],"intro":{"content":"Complete website redesign, branding, and front-end development for DrPawluk.com, an e-commerce platform dedicated to Pulsed Electromagnetic Field (PEMF) therapy devices. Modernized the user experience to strengthen trust among medical professionals and wellness enthusiasts while maintaining a science-driven, credible design.","spmList":[{"id":1,"name":"Complete website redesign with clean, medically inspired visual language."},{"id":2,"name":"Custom interactive PEMF Simulation plugin for visualizing device intensity and field penetration."},{"id":3,"name":"Enhanced site performance with improved loading speed, image scaling, and search functionality."},{"id":4,"name":"Product filtering by power level, system type, and category (Doctor Recommended, Rent-to-Own, Professional)."}]},"previewImage":"/img/portfolio/portfolio/1/6.jpg","gallery":["/img/portfolio/project2/pro26.jpeg","/img/portfolio/project2/pro27.jpeg","/img/portfolio/project2/pro30.jpeg","/img/portfolio/project2/pro29.jpeg","/img/portfolio/project2/pro28.jpeg"],"description":{"content":"DrPawluk.com is an e-commerce platform dedicated to Pulsed Electromagnetic Field (PEMF) therapy devices â€” medical-grade systems that support pain relief, faster recovery, and better sleep. Founded by Dr. William Pawluk, a recognized expert in PEMF technology, the website serves as both a retail hub and an educational resource for individuals seeking non-invasive, science-backed wellness solutions.\\n\\nThe project required a complete website redesign to modernize the user experience and strengthen trust among a diverse audience ranging from medical professionals to wellness enthusiasts. The existing site had an outdated interface, inconsistent branding, and limited performance optimization, making product discovery and comparison difficult.\\n\\nThe redesign process involved discovery and analysis, reviewing the existing website structure, user flows, and navigation logic. We conducted competitor benchmarking and performance diagnostics to identify UX and speed improvement opportunities. The UX/UI design phase focused on redesigning homepage, shop, product, and blog templates for clarity and conversion, introducing a clean, medically inspired visual language that reinforces trust and professional credibility.\\n\\nA key technical achievement was building a custom interactive PEMF Simulation plugin to visualize device intensity and field penetration. This plugin allows visitors to compare devices in real-time, with filtering options by power level, system type, and category (Doctor Recommended, Rent-to-Own, Professional), significantly improving product comparison capabilities.\\n\\nTechnical optimization included implementing a Git-based workflow for transparent version control and efficient collaboration, enhancing site performance with improved loading speed, image scaling, and search functionality. Multiple QA rounds were conducted to eliminate inconsistencies and ensure reliable performance across devices.\\n\\nThe redesigned website now attracts an estimated 5,000+ daily visitors and over 160,000 monthly sessions, with users viewing an average of 4â€“5 pages per visit. The refreshed interface and improved performance made product exploration smoother, while the custom PEMF Simulation plugin increased engagement by allowing visitors to visualize and compare device intensity in real time. The platform successfully serves as a trusted online destination for PEMF therapy solutions, bridging medical expertise with accessible self-care.","techStack":{"frontend":"Modern responsive web design with clean, medically inspired UI, custom interactive PEMF Simulation plugin built with JavaScript, optimized product filtering and comparison interfaces, and performance-optimized image handling.","backend":"E-commerce platform backend with product management, order processing, and inventory management systems, plus search functionality and content management capabilities.","services":"Git-based version control workflow, CDN for optimized asset delivery, performance monitoring and analytics services, and third-party e-commerce integrations.","other":"Custom JavaScript plugins for device visualization, responsive design implementation, SEO optimization, and comprehensive QA and testing processes."}},"liveDemo":{"label":"Live demo","url":"https://www.halo-lab.com/project/drpawluk"},"nextTitle":"Modernizing e-commerce experiences with science-driven design and interactive tools."},{"slug":"cambium-ai-public-data-platform","id":7,"title":{"small":"Data Analytics Â· AI Platform","big":"Public Data, Clear Insights"},"clientURLLink":"https://www.cambium.ai/","projectHeaderImage":"/img/portfolio/project2/bg7.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"Cambium AI (case-study inspired)","date":"2025","categories":[{"id":1,"name":"SaaS","link":"#"}],"tags":[{"id":1,"name":"Python","link":"#"},{"id":2,"name":"Data Processing","link":"#"},{"id":3,"name":"Natural Language Processing","link":"#"},{"id":4,"name":"Data Visualization","link":"#"}],"intro":{"content":"An AI-powered platform that instantly generates complete marketing strategies and answers questions about complex public data. Empowers businesses, researchers, and growth leaders to harness the power of public data for strategic decision-making through visual insights, charts, and maps.","spmList":[{"id":1,"name":"Instant marketing plan generation from website URL with competitor analysis and customer personas."},{"id":2,"name":"Natural language query interface for asking questions about public data without coding."},{"id":3,"name":"Interactive visualizations including charts, maps, and tables exportable in multiple formats."},{"id":4,"name":"Built on transparent, privacy-safe public datasets including U.S. Census and ACS data."}]},"previewImage":"/img/portfolio/portfolio/1/7.jpeg","gallery":["/img/portfolio/project2/pro31.jpeg","/img/portfolio/project2/pro32.jpeg","/img/portfolio/project2/pro33.jpeg","/img/portfolio/project2/pro34.jpeg","/img/portfolio/project2/pro35.jpeg"],"description":{"content":"Cambium AI empowers businesses, researchers, and growth leaders to harness the power of public data for strategic decision-making. Whether launching a new venture, expanding into new markets, refining strategy, or preparing to raise capital, the platform delivers credible, visual data insights that help users move faster and plan with confidence.\\n\\nThe platform offers two main paths to insight: Generate Your Strategic Foundation and Ask Deeper Questions. Users can start by entering their website URL, and the platform instantly builds a complete marketing playbook, providing a clear view of market, competitors, and ideal customer personas. Alternatively, users can ask plain-English questions about community demographics, social trends, or economic indicators to support their research.\\n\\nKey features include instant marketing plan generation that handles initial research, messaging, and competitor analysis so businesses can act faster. The platform provides detailed profiles of target audience segments based on real demographic and economic data, helping businesses understand who their customers are, what they need, and how to reach them effectively.\\n\\nFor deeper insights, users can ask specific business questions about workforce trends, household income, housing density, or any other public data metrics. The platform processes these queries using natural language processing and returns visual, actionable insights in interactive charts and maps that are easily exportable for presentations, business plans, and strategic use.\\n\\nTechnical implementation focuses on processing complex public datasets including U.S. Census Bureau data, American Community Survey (ACS), Economic Census, and other public datasets. The platform handles data cleaning, transformation, and visualization automatically, making complex data accessible to everyone without requiring technical skills.\\n\\nThe platform is built on transparent, privacy-safe public datasets, ensuring compliance with regulatory standards while making complex data accessible. Data is updated regularly to ensure accuracy, and the system provides export capabilities in multiple formats including PNG, PDF, CSV, and PowerPoint-ready files.\\n\\nThe result is a platform that enables users to stop guessing and start growing with data they can trust. Users can get reliable market and demographic insights in minutes instead of waiting weeks for traditional research, access data without paying thousands for analyst reports, and make data-driven decisions with confidence. The platform successfully serves founders, small businesses, and public policy makers, helping them validate concepts, plan expansion, and prepare investor materials with precisely the data visualizations they need.","techStack":{"frontend":"Interactive data visualization dashboards, natural language query interface, interactive charts and maps, and export functionality for multiple formats (PNG, PDF, CSV, PowerPoint).","backend":"Python-based data processing pipelines, natural language processing engines for query understanding, data transformation and cleaning services, and RESTful API architecture.","services":"Public data integration services (U.S. Census, ACS, Economic Census), data cleaning and transformation pipelines, visualization generation services, and export service for multiple file formats.","other":"Data processing and ETL pipelines, natural language query processing, interactive visualization libraries, and comprehensive data analytics and reporting systems."}},"liveDemo":{"label":"Live demo","url":"https://www.cambium.ai/"},"nextTitle":"Transforming public data into actionable insights for strategic decision-making."},{"slug":"nesh-sales-ai-platform","id":8,"title":{"small":"Sales AI Â· Advanced Manufacturing","big":"Sales AI for Advanced Manufacturing"},"clientURLLink":"https://www.hellonesh.io/","projectHeaderImage":"/img/portfolio/project2/bg8.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"Nesh (case-study inspired)","date":"2025","categories":[{"id":1,"name":"SaaS","link":"#"}],"tags":[{"id":1,"name":"AI","link":"#"},{"id":2,"name":"Machine Learning","link":"#"},{"id":3,"name":"NLP","link":"#"},{"id":4,"name":"Enterprise Software","link":"#"}],"intro":{"content":"An AI-powered sales platform designed for complex industries including Specialty Chemicals, Aerospace, Agricultural Chemicals, and Industrial Coatings. Accelerates revenue by providing intelligent, single source of truth that unlocks competitive advantage through expert knowledge capture and AI-powered go-to-market solutions.","spmList":[{"id":1,"name":"Nesh Avatars: AI team members with specialized expertise for unique business processes."},{"id":2,"name":"Product Recommender, Compare & Benchmark, and Application & Troubleshooting tools."},{"id":3,"name":"Expert knowledge capture to retain insights before experts leave or retire."},{"id":4,"name":"Private, secure architecture designed from the ground up for enterprise security requirements."}]},"previewImage":"/img/portfolio/portfolio/1/8.jpg","gallery":["/img/portfolio/project2/pro36.jpeg","/img/portfolio/project2/pro37.jpeg","/img/portfolio/project2/pro38.jpeg","/img/portfolio/project2/pro39.jpeg","/img/portfolio/project2/pro40.jpeg"],"description":{"content":"Nesh is a Sales AI platform specifically designed for advanced manufacturing industries, helping companies from Specialty Chemicals and Industrial Coatings to Aerospace and Agricultural Chemicals accelerate revenue with the most advanced AI designed for complex industries.\\n\\nThe platform serves as an intelligent, single source of truth that unlocks competitive advantage by leveraging complete product portfolios and services. It enables technical sales teams to troubleshoot customer product applications, benchmark against competitors, and supercharge their sales cycle with AI-powered insights.\\n\\nKey features include Expert Knowledge Capture, allowing companies to retain their expert\'s knowledge and insights before they leave or retire. Nesh Avatars extend teams with specialized expertise relevant to unique business processes, functioning as AI team members that provide domain-specific subject matter expertise.\\n\\nThe platform offers AI-powered go-to-market solutions including Product Recommender for intelligent product suggestions, Compare & Benchmark tools for competitive analysis, and Application & Troubleshooting capabilities that help teams solve customer challenges quickly.\\n\\nNesh is designed for teams across the advanced manufacturing value chain: Technical Sales, Technical Services, and Customer Experience. For technical sales, a single technical sales rep can generate 65% more revenue with increased support from subject matter experts. The platform delivers the knowledge and actionable insights technical sales teams need to hit their goals.\\n\\nFor technical services, Nesh empowers teams with a smarter way to build strong customer relationships across all accounts, big or small. Customer Experience teams can set customers and channel partners up for success with customer-facing Nesh Avatars, gaining insights into customer pain points and helping troubleshoot as they implement products or services.\\n\\nSecurity and privacy are fundamental. The model architecture was designed from the ground up to support customer\'s security and data privacy requirements. The platform handles the complexity of understanding content within unstructured Chemical Industry data and delivers a great experience when searching for technical and specific domain information.\\n\\nThe platform helps companies proactively capture expert product knowledge and reduce team knowledge gaps, onboard and mobilize new sellers faster, close channel partner\'s technical knowledge gaps, and build technical sales and services strategies that drive growth. Companies like Colorcon, BASF, and IEEE rely on Nesh to fully harness data within their product portfolios and enhance their commercial team\'s ability to serve customer needs.","techStack":{"frontend":"Enterprise-grade web application with AI-powered interfaces, Nesh Avatar interaction interfaces, product recommendation and comparison tools, and knowledge capture interfaces.","backend":"Machine learning and NLP processing engines, AI model serving infrastructure, knowledge base management systems, and enterprise-grade API architecture with security and privacy controls.","services":"AI-powered knowledge capture services, Nesh Avatar AI services, product recommendation engines, competitive benchmarking services, and enterprise security and compliance infrastructure.","other":"Natural language processing for unstructured data, domain-specific AI models, knowledge graph construction, and enterprise integration capabilities."}},"liveDemo":{"label":"Live demo","url":"https://www.hellonesh.io/"},"nextTitle":"Accelerating revenue with AI-powered sales intelligence for complex industries."},{"slug":"posabit-cannabis-pos-platform","id":9,"title":{"small":"Cannabis Retail Â· Point of Sale","big":"At the Heart of the Modern Cannabis Experience"},"clientURLLink":"https://www.posabit.com/","projectHeaderImage":"/img/portfolio/project2/bg9.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"POSaBIT (case-study inspired)","date":"2024","categories":[{"id":1,"name":"Business","link":"#"}],"tags":[{"id":1,"name":"Point of Sale","link":"#"},{"id":2,"name":"Payment Processing","link":"#"},{"id":3,"name":"Compliance","link":"#"},{"id":4,"name":"Full-Stack","link":"#"}],"intro":{"content":"A premier cannabis point of sale platform that helps retailers stay compliant, grow revenue, and wow customers. Features integrated loyalty programs, customizable discounts, detailed reporting, and omnichannel commerce capabilities designed specifically for the cannabis industry.","spmList":[{"id":1,"name":"POSaBIT POS with integrated loyalty, customizable discounts, and detailed reporting for efficient operations."},{"id":2,"name":"POSaBIT Menus for omnichannel commerce with seamless online ordering and delivery workflows."},{"id":3,"name":"Compliant payment solution providing normalized purchasing experience for cannabis retailers."},{"id":4,"name":"Robust security, compliance features, and open API for reliable platform support."}]},"previewImage":"/img/portfolio/portfolio/1/9.jpg","gallery":["/img/portfolio/project2/pro41.jpeg","/img/portfolio/project2/pro42.jpeg","/img/portfolio/project2/pro43.jpeg","/img/portfolio/project2/pro44.jpeg","/img/portfolio/project2/pro45.jpeg"],"description":{"content":"POSaBIT is the premier cannabis point of sale platform designed to help retailers stay compliant, grow revenue, and wow customers. The platform offers a comprehensive solution that addresses the unique needs of the cannabis retail industry, combining point of sale functionality, online ordering, payment processing, and compliance management in one integrated system.\\n\\nPOSaBIT POS offers integrated loyalty programs, customizable discounts, and detailed reporting to help cannabis retailers operate efficiently. With its intuitive interface, robust reporting, and support for workflows including delivery, POSaBIT POS provides the ultimate retail experience that drives sales and loyalty. The user-friendly POS increases transaction speed and basket size while equipping budtenders to serve and upsell customers effectively.\\n\\nPOSaBIT Menus enables omnichannel commerce, meeting customers wherever they are with an online ordering system that syncs seamlessly with in-store and delivery sales. The platform provides a unified customer experience by leveraging customer profiles and purchase history data to deliver personalized offers and product recommendations. The robust reporting dashboard gives real-time analytics across all sales channels, enabling retailers to optimize operations and unify inventory, customer, and order data to streamline fulfillment.\\n\\nKey benefits include better customer experience through convenient and seamless checkout, robust real-time reports and insights that unite the entire POSaBIT platform, user-friendly systems that support employees with confidence and expertise, and lower costs through an affordable all-in-one system. The platform features white glove support with personal 24/7 assistance, starting with white glove implementation where an individual answers every call or email.\\n\\nThe platform drives higher sales through features and efficiencies that save money and provide countless opportunities for in-store upselling. Retailers report seeing average transaction increases of 30% when customers use POSaBIT, with budtenders receiving almost 60% more tips. The system enables better upselling opportunities, with budtenders seeing their tips triple, making them more motivated at work.\\n\\nTechnical implementation focuses on robust security and compliance features essential for the cannabis industry. The platform includes an open API for integrations, allowing retailers to connect with other systems and tools. The compliant payment solution provides a normalized purchasing experience, addressing the unique payment challenges in the cannabis industry.\\n\\nThe platform is built to support cannabis businesses with dedicated support, unique functionality like tipping and delivery workflows, and comprehensive features that make it the only solution cannabis retailers need to grow. POSaBIT\'s experienced team continually innovates based on customer needs and industry trends, ensuring the platform evolves with the rapidly changing cannabis retail landscape.","techStack":{"frontend":"Point of sale interface with intuitive touch-screen design, online ordering platform (POSaBIT Menus), responsive web dashboards for reporting and analytics, and mobile-friendly interfaces for delivery workflows.","backend":"Full-stack POS system with transaction processing, inventory management, order processing and fulfillment systems, customer relationship management, and comprehensive reporting engines.","services":"Payment processing services with cannabis industry compliance, loyalty program services, delivery workflow management, compliance tracking and reporting services, and open API for third-party integrations.","other":"Cannabis industry-specific compliance features, real-time inventory synchronization, customer profile and purchase history analytics, and comprehensive reporting and analytics dashboards."}},"liveDemo":{"label":"Live demo","url":"https://www.posabit.com/"},"nextTitle":"Transforming cannabis retail with compliant, efficient, and customer-focused technology."},{"slug":"versus-trade-trading-platform","id":10,"title":{"small":"Trading Platform Â· Fintech","big":"Life Changing Trading"},"clientURLLink":"https://versus.trade/","projectHeaderImage":"/img/portfolio/project2/bg10.jpeg","videoLink":"https://vimeo.com/127203262","clientURLName":"Versus Trade (case-study inspired)","date":"2025","categories":[{"id":1,"name":"Finance","link":"#"}],"tags":[{"id":1,"name":"MetaTrader 5","link":"#"},{"id":2,"name":"Real-time Trading","link":"#"},{"id":3,"name":"Mobile App","link":"#"},{"id":4,"name":"Full-Stack","link":"#"}],"intro":{"content":"A revolutionary trading platform built by traders for traders, offering paper-thin spreads and innovative Versus Pairs trading. Features 2000:1 leverage, $10 minimum deposit, 24/7 withdrawals, and zero swap fees across Forex, Commodities, Stocks, Indices, and Crypto markets.","spmList":[{"id":1,"name":"MetaTrader 5 platform available on Desktop (Windows, MacOS), Mobile (Android, iOS), and Web."},{"id":2,"name":"Innovative Versus Pairs trading: trade assets against each other (BTC vs Gold, Tesla vs Ford)."},{"id":3,"name":"Paper-thin spreads with tight pricing: 0.8 pips on EURUSD, 1.2 pips on XAUUSD, 0.6 pips on AAPL."},{"id":4,"name":"Multiple account types: Standard, Professional, Islamic, and Demo trading accounts."}]},"previewImage":"/img/portfolio/portfolio/1/10.jpg","gallery":["/img/portfolio/project2/pro51.jpeg","/img/portfolio/project2/pro47.jpeg","/img/portfolio/project2/pro48.jpeg","/img/portfolio/project2/pro49.jpeg","/img/portfolio/project2/pro50.jpeg"],"description":{"content":"Versus Trade is a revolutionary trading platform built by traders for traders, designed to create a true emotional connection to trading. The platform offers life-changing trading opportunities with paper-thin spreads made to maximize trading potential across multiple asset classes.\\n\\nThe platform provides access to Forex CFD, Commodities CFD, Stocks CFD, Indices CFD, and Crypto CFD markets. Key trading conditions include 2000:1 leverage, zero swap fees, $10 minimum deposit, and 24/7 withdrawals. The platform is regulated by FSC Mauritius and registered in Saint Lucia, with Sumsub KYC service integration for secure account verification.\\n\\nA standout feature is the innovative Versus Pairs trading, allowing traders to trade assets against each other in revolutionary ways. Examples include BTC vs Gold, Pepsi vs Cola, and Tesla vs Ford. This unique approach lets traders pick the side they believe in, creating a whole new way of trading where price rises when the first asset gains value or the second one drops.\\n\\nThe platform offers paper-thin spreads across all markets: Forex pairs like EURUSD at 0.8 pips average spread and GBPUSD at 0.9 pips, Commodities like XAUUSD at 1.2 pips and WTI at 0.3 pips, Stocks like AAPL at 0.6 pips, Indices like US30 at 2.0 pips, and Crypto like BTCUSD at 250.0 pips. Gold trading offers particularly tight spreads: 0.6 pips on Raw Spread, 1.2 pips on Pro, and 2.0 pips on Standard accounts.\\n\\nTechnical infrastructure focuses on keeping the system stable with servers located in London, 24/7 system tech monitoring, low-latency connections with liquidity providers, and combining feeds from top liquidity providers for the best quotes. The platform is built with next-level design for convenience, fast automated KYC process, cutting-edge technology for minimal downtime, and mobile app availability for trading on the go.\\n\\nThe platform supports multiple account types including Standard accounts, Professional accounts, Islamic accounts (swap-free), and Demo trading accounts for risk-free practice. Withdrawals are quick via local and global methods, with no withdrawal fees, and deposits and withdrawals flow 24/7 non-stop.\\n\\nVersus Trade has been recognized as Best for Traders Asia 2025, Best Trading Conditions MENA 2025, and Fast Growing Broker 2025. The platform is built on MetaTrader 5, an advanced, reliable platform trusted by millions of pro traders worldwide, available across all major platforms including Windows, MacOS, Android, iOS, and WebTerminal.\\n\\nThe platform creates an environment made by traders who know what really plays a role, offering customer care in multiple languages, ensuring traders feel supported throughout their trading journey. The platform enables traders to flip the market versus it, taking full control of their future with passion and purpose.","techStack":{"frontend":"MetaTrader 5 platform interfaces for Desktop (Windows, MacOS), Mobile apps (Android, iOS), and WebTerminal, with intuitive trading interfaces and real-time market data visualization.","backend":"High-performance trading engine with low-latency execution, real-time market data processing, order management systems, and account management infrastructure supporting multiple account types.","services":"Low-latency connectivity to liquidity providers in London, 24/7 system monitoring services, automated KYC processing via Sumsub integration, payment processing for deposits and withdrawals, and Versus Pairs trading engine.","other":"MetaTrader 5 platform integration, real-time market data aggregation from multiple liquidity providers, risk management systems, and multi-language customer support infrastructure."}},"liveDemo":{"label":"Live demo","url":"https://versus.trade/"},"nextTitle":"Empowering traders with innovative technology and paper-thin spreads for life-changing opportunities."}]');

